import { StatusBar } from "expo-status-bar";
import React, { useEffect, useState } from "react";
import {
  View,
  SafeAreaView,
  Button,
  FlatList,
  Text,
  StyleSheet,
  Modal,
  Image,
  TouchableOpacity,
} from "react-native";
import Card from "../components/Card/Card";
import { Data } from "../models/Data";
import { ScreenFC } from "../models/ScreenFC";
import { useDispatch } from "react-redux";
import { addBookmark } from "../redux/actions/bookmarkActions";
import { ScrollView } from "react-native-gesture-handler";

const HomeScreen: ScreenFC<"Home"> = ({ navigation, route }) => {
  const [stateapi, setState] = useState<Array<Data>>([]);
  const [selectedContact, setSelectedContact] = useState<Data | null>(null);
  const dispatch = useDispatch();

  interface UserData {
    id: number;
    firstName: string;
    lastName: string;
    phone: string;
    picture: string;
  }

  useEffect(() => {
    fetch('https://randomuser.me/api/?results=26')
      .then(response => response.json())
      .then(data => {
        const users: UserData[] = data.results.map((user: any) => ({
          firstName: user.name.first,
          lastName: user.name.last,
          phone: user.phone,
          picture: user.picture.large,
          id: user.id.value,
        }));
        setState(users);
      })
      .catch(error => console.log(error));
  }, []);

  useEffect(() => {
    const timeout = setTimeout(() => {
      fetch('https://randomuser.me/api/?results=26')
        .then(response => response.json())
        .then(data => {
          const users: UserData[] = data.results.map((user: any) => ({
            firstName: user.name.first,
            lastName: user.name.last,
            phone: user.phone,
            picture: user.picture.large,
          }));
          setState(users);
        })
        .catch(error => console.log(error));
    }, 12000); // 120 seconds
    return () => clearTimeout(timeout);
  }, [stateapi]);

  const handleCardPress = (contact: Data) => {
    setSelectedContact(contact);
  };

  const handleModalClose = () => {
    setSelectedContact(null);
  };
// Handle add to bookmarks
const handleAddToBookmarks = (contact: Data) => {
dispatch(addBookmark(contact));
setSelectedContact(null);
};

return (
<SafeAreaView style={styles.container}>
<ScrollView>
<View style={styles.container}>
{stateapi.length > 0 ? (
<FlatList
data={stateapi}
keyExtractor={item => item.id.toString()}
renderItem={({ item }) => (
<TouchableOpacity onPress={() => handleCardPress(item)}>
<Card
item={item} isBookmarked={false} index={0}  />
</TouchableOpacity>
)}
numColumns={2}
/>
) : (
<Text>Loading...</Text>
)}
</View>
</ScrollView>
<Modal visible={selectedContact !== null} animationType="slide">
<View style={styles.modalContainer}>
{selectedContact !== null && (
<View style={styles.modalContainer}>
<Image
source={{ uri: selectedContact.picture }}
style={styles.modalImage}
/>
<Text style={styles.modalText}>
{selectedContact.firstName} {selectedContact.lastName}
</Text>
<Text style={styles.modalPhone}>{selectedContact.phone}</Text>
<View style={styles.modalButton}>
<Button
title="Add to Bookmarks"
onPress={() => handleAddToBookmarks(selectedContact)}
/>
<Button title="Close" onPress={handleModalClose} />
</View>
</View>
)}
</View>
</Modal>
<StatusBar style="auto" />
</SafeAreaView>
);
};


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
    padding: 20,
  },
  headerContainer: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 10,
  },
  headerText: {
    fontSize: 24,
    fontWeight: "bold",
  },
  flatListContainer: {
    flex: 1,
  },
  modalContainer: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  modal: {
    backgroundColor: "#fff",
    borderRadius: 5,
    padding: 20,
    alignItems: "center",
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
  modalImage: {
    width: 150,
    height: 150,
    marginBottom: 10,
    borderRadius: 75,
  },
  modalText: {
    fontSize: 20,
    marginBottom: 10,
  },
  modalPhone: {
    fontSize: 20,
    marginBottom: 10,
  },
  modalButton: {
    marginTop: 20,
  },
});
export default HomeScreen;
